import SwiftUI

struct ProfileView: View {
    @Environment(\.designTheme) private var theme
    @State private var currentUser = User.currentUser
    @State private var showingGoLive = false
    @State private var showingPrivacySettings = false

    var body: some View {
        NavigationStack {
            GeometryReader { geo in
                ZStack {
                    // Background photo - constrained to screen bounds
                    Image(currentUser.profileImageName)
                        .resizable()
                        .aspectRatio(contentMode: .fill)
                        .frame(width: geo.size.width, height: geo.size.height)
                        .clipped()
                        .accessibilityHidden(true)

                    // Gradient overlay
                    LinearGradient(
                        gradient: Gradient(colors: [
                            Color.clear,
                            theme.color(.foreground).opacity(0.65)
                        ]),
                        startPoint: UnitPoint(x: 0.5, y: 0.55),
                        endPoint: .bottom
                    )

                    // Content
                    ScrollView {
                        VStack(spacing: 0) {
                            Spacer()
                                .frame(height: geo.size.height * 0.55)

                            GlassEffectContainer {
                                VStack(spacing: 0) {
                                    // Profile Info Card
                                    VStack(spacing: .spacing1) {
                                        Text(currentUser.fullName)
                                            .font(theme.font(.title2))
                                            .fontWeight(.bold)
                                            .foregroundStyle(theme.color(.primaryforeground))
                                            .accessibilityAddTraits(.isHeader)

                                        Text("\(currentUser.sport) • \(currentUser.position) • \(currentUser.classYear)")
                                            .font(theme.font(.subheadline))
                                            .foregroundStyle(theme.color(.mutedforeground))
                                    }
                                    .frame(maxWidth: .infinity)
                                    .photoOverlayCard()

                                    // Menu Items
                                    VStack(spacing: .spacing3) {
                                        MenuItem(icon: "person.fill", title: "About", iconColor: theme.color(.primary), destination: AboutView())
                                        MenuItem(icon: "video.fill", title: "Film", iconColor: theme.color(.destructive), destination: FilmView())
                                        MenuItem(icon: "pencil", title: "Posts", iconColor: theme.color(.success), destination: PostsView())
                                        MenuItem(icon: "figure.run", title: "Athletics", iconColor: theme.color(.warning), destination: AthleticsView())
                                        MenuItem(icon: "book.fill", title: "Academics", iconColor: theme.color(.accent), destination: AcademicsView())
                                    }
                                }
                                .glassEffect(.regular, in: .rect(cornerRadius: 32))
                            }
                            .padding(.horizontal, .spacing4)
                            .padding(.top, .spacing4)
                            .padding(.bottom, 100)
                        }
                    }
                    .scrollContentBackground(.hidden)
                }
                .ignoresSafeArea()
            }
            .sheet(isPresented: $showingGoLive) {
                GoLiveView()
            }
            .overlay(
                HStack(spacing: .spacing4) {
                    Spacer()
                    Button(action: {
                        showingGoLive = true
                    }) {
                        Image(systemName: "video.fill")
                            .foregroundStyle(theme.color(.destructiveforeground))
                            .font(theme.font(.title3))
                            .padding(.spacing2)
                    }
                    .buttonStyle(.glass)
                    .shadowMedium()
                    .accessibilityLabel("Go live")
                    .accessibilityHint("Start a live video stream")

                    Button(action: {
                        showingPrivacySettings = true
                    }) {
                        Image(systemName: "gearshape.fill")
                            .foregroundStyle(theme.color(.foreground))
                            .font(theme.font(.title3))
                            .padding(.spacing2)
                    }
                    .buttonStyle(.glass)
                    .shadowMedium()
                    .accessibilityLabel("Settings")
                    .accessibilityHint("Open privacy and account settings")
                }
                .padding(.horizontal, .spacing5)
                .padding(.top, 50)
                , alignment: .top
            )
            .sheet(isPresented: $showingPrivacySettings) {
                PrivacySettingsView(privacySettings: $currentUser.privacySettings)
            }
        }
        .withDesignTheme()
    }
}

#Preview {
    ProfileView()
}

